const About = () => {
  return (
    <>
    
      <div className="tittle">
        <span className="welcome">Welcome to Boxxoffice!</span>
        <a target="_blank" href="./A" className="white-mode">
          Read About Us
        </a>
      </div>

    </>
  )
}

export default About;
